import logo from './logo.svg';
import './App.css';


function App() {
  return (

    <>
      <Sidebar />
      <main className="main">
        <Home />
        <About />
        <Resume />
        <Services />
        <Portfolio />
        <Pricing />
        <Testimonials />
        <Blog />
        <Contact />
      </main>
    </>
  );
}

export default App;
